import { Component } from '@angular/core';
import { GetqouteService } from 'src/app/services/getqoute.service';
import { UserService } from 'src/app/services/user.service';

@Component({
  selector: 'app-vehicle-list',
  templateUrl: './vehicle-list.component.html',
  styleUrls: ['./vehicle-list.component.scss']
})
export class VehicleListComponent {
  vehicles: any;
  constructor(
    private vehicleService:GetqouteService,
  private userService:UserService
  ){}
  ngOnInit(): void {

    this.fetchVehiclesByEmail(this.userService.getUserEmail());
  }

    fetchVehiclesByEmail(email: string): void {

      this.vehicleService.getVehiclesByEmail(this.userService.getUserEmail()).subscribe(
        (response: any[]) => {
          this.vehicles = response;
        },
        (error: any) => {
          console.error('Error fetching vehicles by email:', error);
        }
      );
    }
}

<h2>Vehicles</h2>

<table>
  <thead>
    <tr>
      <th>Registeration Number</th>
      <th>Color</th>
      <th>Model</th>
      <th>Year</th>




    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let vehicle of vehicles">
      <td>{{ vehicle.registrationNumber }}</td>
      <td>{{ vehicle.color }}</td>
      <td>{{ vehicle.model }}</td>
      <td>{{ vehicle.year }}</td>

    </tr>
  </tbody>
</table>
